class SwapiService {

  async getResourse() {
    const getSource = async (url) => {
      const res = await (url);

      if(!res.ok) {
        throw new Error(`Couldn't fetch ${url}` + `, recieved ${res.status}`)
      }

      const body = await res.body;
    };
  }
}

